const Featured = () => {
  return (
    <section id="featured-section" className="container">
      <div
        style={{ width: "12rem", height: "12rem", backgroundColor: "red" }}
      ></div>
      <div
        style={{ width: "12rem", height: "12rem", backgroundColor: "blue" }}
      ></div>
    </section>
  );
};

export default Featured;
